.logo {
  font-size: 40px;
  line-height: 1.1;
  color: #00a99d;
  position: absolute;
  z-index: 9999999999999;
  text-decoration: none;
}
.logo:after {
  content: '\e900';
  font-family: 'icons';
  font-style: normal;
  text-align: center;
  font-size: 1em;
}
/** Upgrade alert **/
