    font-size: 24px;
  }
  .upgrade-alert .logo:after {
    content: '\e900';
  }
}
@media only screen and (max-width: 230px), only screen and (max-height: 120px) {
  .upgrade-alert .logo {
    display: none;
  }
}
/** Landing screen **/
.visual-landing {
  width: 100vw;
  height: 100vh;
  font-family: "Segoe UI Light", wf_segoe-ui_bold, helvetica, arial, sans-serif;
  overflow: hidden;
}
.visual-landing .watermark {
  height: 100%;
  width: auto;
}
.visual-landing .watermark svg {
  width: 100%;
  height: 100%;
}
.visual-landing .logo {
  bottom: 0;
  right: 0;
  background: #fff;
  font-size: 30px;
  color: #C8C8C8;
}
.visual-landing .logo:after {
  content: '\e900';
}
.visual-landing .logo:hover {
