/* Body */
body {
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  shape-rendering: crispEdges;
}
.visual-header {
  position: absolute;
  right: 12px;
  z-index: 99999999;
  display: none;
}
body:hover .visual-header {
  display: block;
}
.visual-header {
  top: 0;
}
.version-info {
  font-size: 11px;
  text-transform: uppercase;
  letter-spacing: 0.5px;
  color: #ccc;
  padding: 0 5px;
  clear: both;
}

.templatesContainer {
  position: absolute;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  z-index: 9999999999;
  height: 100%;
  background: #f4f4f4;
}
.templatesContainer.dummy .templateItemReq:not(.strict) {
  display: none;
}
.templatesControls {
  display: -ms-flex;
  display: flex;
  -ms-align-items: center;
  align-items: center;
  -ms-justify-content: flex-start;
  justify-content: flex-start;
  padding: 20px;
}
.templatesControls .label {
  font-size: 11px;
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  color: #666;
  margin: -1px 20px 0 5px;
}
.templatesTitle {
  font-size: 14px;
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  text-transform: uppercase;
  color: #666;
  line-height: 1.4;
  margin-right: auto;
}
.templateSave {
  margin-right: 25px;
  text-decoration: none;
  font-size: 11px;
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  color: #797979;
}
.templateSave:hover {
  color: #444;
}
.templateSave:before {
  content: '\e74e';
  font-family: 'icons';
  font-style: normal;
  text-align: center;
  vertical-align: middle;
  font-size: 16px;
  margin: 0 5px 0 0;
}
.templatesHide {
  position: absolute;
  top: 16px;
  right: 14px;
  z-index: 999999;
  cursor: pointer;
  width: 14px;
  height: 12px;
  color: #797979;
}
.templatesHide:before {
  content: '\e711';
  font-family: 'icons';
  font-style: normal;
  text-align: center;
  vertical-align: middle;
  font-size: 14px;
  line-height: 9px;
}
.templatesHide:hover {
  color: #444;
}
.templatesShow {
  position: absolute;
  bottom: 0;
  right: 0;
  z-index: 999999;
  cursor: pointer;
  width: 22px;
  height: 20px;
  padding: 4px ;
  text-align: center;
  background: rgba(255, 255, 255, 0.8);
}
.templatesShow:before {
  content: '\f26f';
  font-family: 'icons';
  font-style: normal;
  text-align: center;
  vertical-align: top;
  font-size: 15px;
  line-height: 24px;
  color: #797979;
}
.templatesShow:hover:before {
  color: #444;
}
.templatesShow svg {
  fill: #797979;
  height: 18px;
  width: 20px;
}
.templatesShow svg:hover {
  fill: #444;
}
.previewContainer {
  overflow: hidden;
  overflow-y: auto;
  height: calc(100% - 80px);
  padding: 0 20px 20px 20px;
  display: -ms-flex;
  display: flex;
  -ms-align-items: flex-start;
  align-items: flex-start;
  -ms-justify-content: flex-start;
  justify-content: flex-start;
  align-content: flex-start;
  -ms-flex-wrap: wrap;
  flex-wrap: wrap;
}
.templateItemContainer {
  flex: 0 1  auto;
  position: relative;
  margin-bottom: 10px;
}
.templateItemContainer:hover .templateItemRemove {
  display: initial;
}
.templateItemContainer:not(.locked):hover .templateItem {
  border-color: #f2c53e;
}
.templateItemContainer.locked {
  cursor: not-allowed;
}
.templateItemContainer.locked .templateItem,
.templateItemContainer.locked .templateItemName,
.templateItemContainer.locked .templateItemDesc {
  opacity: 0.8;
}
.templateItem,
.templateFile {
  background: #fff;
  border: 3px solid #fff;
  padding: 2px;
  margin: 5px;
  overflow: hidden;
  display: -ms-flex;
  display: flex;
  -ms-align-items: center;
  align-items: center;
  -ms-justify-content: center;
  justify-content: center;
}
.templateItemName {
  font-size: 13px;
  line-height: 1.5;
  padding: 0 10px;
  font-family: wf_standard-font, helvetica, arial, sans-serif;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.templateItemDesc {
  font-size: 10px;
  line-height: 1.3;
  padding: 0 10px;
  font-family: "Segoe UI", wf_segoe-ui_bold, helvetica, arial, sans-serif;
  color: #333;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: normal;
}
.templateItemReqContainer {
  padding: 2px;
  line-height: 1;
  position: absolute;
  z-index: 99999999;
  top: 5px;
  left: 5px;
}
.templateItemReq {
  font-size: 9px;
  box-sizing: border-box;
  text-transform: uppercase;
  line-height: 9px;
  font-family: wf_standard-font, helvetica, arial, sans-serif;
  padding: 5px 3px 3px 3px;
  background: #fef8b7;
  color: #918f7c;
  display: inline-block;
  margin: 0 2px;
}
.templateItemReq:before {
  content: '\e7ba';
  font-family: 'icons';
  font-style: normal;
  text-align: center;
  vertical-align: middle;
  font-size: 9px;
  line-height: 9px;
  margin-right: 2px;
}
.templateItemReq.strict:before {
  content: '\e733';
  margin-right: 3px;
  font-size: 8px;
}
.templateItemReq.strict {
  background: #333;
  color: #fff;
}
.templateItemRemove {
  display: none;
  position: absolute;
  top: 5px;
  right: 5px;
  z-index: 999999;
  cursor: pointer;
  width: 15px;
  height: 15px;
  line-height: 1;
  text-align: center;
  background: #f2c53e;
}
.templateItemRemove:before {
  content: '\e711';
  font-family: 'icons';
  font-style: normal;
  text-align: center;
  vertical-align: top;
  font-size: 7px;
  line-height: 18px;
  color: #666;
}
.templateItemRemove:hover:before {
  color: #000;
}
.templateFile {
  flex: 0 1  auto;
  background: none;
  border: none;
}
.templateFile svg {
  fill: #bbb;
  height: 50px;
  width: 66px;
  cursor: pointer;
}
.templateFile svg:hover {
  fill: #444;
}
.file {
  visibility: hidden;
  height: 1px;
  width: 1px;
  position: absolute;
}
.switch {
  flex-shrink: 0;
  position: relative;
  display: inline-block;
  width: 26px;
  height: 14px;
}
.switch input {
  display: none;
}
.switch .slider {
  position: absolute;
  cursor: pointer;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  border: 1px solid #797979;
  background-color: none;
  -webkit-transition: 0.4s;
  transition: 0.4s;
  border-radius: 20px;
}
.switch .slider:before {
  position: absolute;
  content: "";
  height: 8px;
  width: 8px;
  left: 2px;
  bottom: 2px;
  background-color: #797979;
  -webkit-transition: 0.4s;
  transition: 0.4s;
  border-radius: 50%;
}
.switch .slider:hover {
  border-color: #444;
}
.switch .slider:hover:before {
  background-color: #444;
}
.switch input:checked + .slider {
  background-color: #f2c53e;
  border-color: #f2c53e;
}
.switch input:focus + .slider {
  box-shadow: 0 0 1px #f2c53e;
}
.switch input:checked + .slider:before {
  transform: translateX(12px);
  background-color: #fff;
}
@media only screen and (max-width: 300px) {
  .templatesControls .switch,
  .templatesControls .label {
    display: none;
  }
}
@media only screen and (max-width: 160px) {
  .templatesControls {
    display: none;
  }
}

.cardsContainer {
  font-size: 0;
}
.card,
.card-preview {
  display: inline-block;
  box-sizing: border-box;
  -moz-box-sizing: border-box;
  -webkit-box-sizing: border-box;
  overflow: hidden;
}
.label {
  font-weight: normal;
  text-size-adjust: 100%;
}
.point {
  pointer-events: none;
}
.point.active,
.point.selected {
  fill-opacity: 1 !important;
}
.trendlineContainer {
  shape-rendering: geometricPrecision;
}


